def name = context.expand('${#System#user.home}')

log.info ("Property Name is  : "+name);

class Hello{

	def log;
	def context;
	def testRunner;

	def Hello(log,context,testRunner){
		this.log=log
		this.context=context
		this.testRunner=testRunner
	}

	def sayHello(String name){
		log.info ("Hello " +name);
	}
}

context.setProperty("Hello", new Hello(log,context,testRunner))

// to call from different test case
def testStep = testRunner.testCase.testSuite.project.testSuites["TestSuit3"].testCases["TestCase1"].getTestStepByName("Hello");




// to call from same test case
//def testStep = testRunner.testCase.getTestStepByName("Hello")

testStep.run(testRunner, context)

context.Hello.sayHello("Nishant")

def status = testRunner.runTestStepByName("GetCountryISOCode")
def result = status.getStatus().toString();
log.info ("   ---- "+result)
